import '../css/App.css';

const SideNav = ({ list }) => {
	const tabItem = Object.keys(list).map(key => list[key])
	console.log(tabItem)
	return (
		<footer className="App-sideNav">
			{tabItem.map(tab => (
				<div>{tab}</div>
			))}
		</footer>
	);
}

export default SideNav;
